/*Table structure for table `good` */

DROP TABLE IF EXISTS `good`;

CREATE TABLE `good` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sid` int(11) NOT NULL COMMENT '商店ID',
  `name` varchar(200) NOT NULL COMMENT '名称',
  `price` decimal(10,2) NOT NULL COMMENT '价格',
  `score` int(11) DEFAULT '1' COMMENT '商品积分',
  `picPath` varchar(255) DEFAULT NULL COMMENT '图片路径',
  `videoPath` varchar(50) DEFAULT NULL COMMENT '视频路径',
  `buyCount` int(11) DEFAULT '0' COMMENT '销售量',
  `repertory` int(11) NOT NULL COMMENT '库存',
  `type1` int(11) DEFAULT NULL COMMENT '一级分类',
  `type2` int(11) DEFAULT NULL COMMENT '二级分类',
  `type3` int(11) DEFAULT NULL COMMENT '三级分类',
  `describe` varchar(255) DEFAULT NULL COMMENT '描述',
  `state` int(11) DEFAULT '1' COMMENT '0:待审核，1:passed 2.faild',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `fk_good_shop_sid` (`sid`),
  KEY `fk_good_cate_type1` (`type1`),
  KEY `fk_good_cate_type2` (`type2`),
  KEY `fk_good_cate_type3` (`type3`),
  CONSTRAINT `fk_good_cate_type1` FOREIGN KEY (`type1`) REFERENCES `category` (`id`),
  CONSTRAINT `fk_good_cate_type2` FOREIGN KEY (`type2`) REFERENCES `category` (`id`),
  CONSTRAINT `fk_good_cate_type3` FOREIGN KEY (`type3`) REFERENCES `category` (`id`),
  CONSTRAINT `fk_good_shop_sid` FOREIGN KEY (`sid`) REFERENCES `shop` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=859 DEFAULT CHARSET=utf8;

