/*Table structure for table `order` */

DROP TABLE IF EXISTS `order`;

CREATE TABLE `order` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键自增',
  `uid` int(11) NOT NULL COMMENT '用户id',
  `sid` int(11) NOT NULL COMMENT '商店id',
  `gid` int(11) NOT NULL COMMENT '商品id',
  `number` int(11) DEFAULT NULL COMMENT '数量',
  `price` decimal(10,2) NOT NULL COMMENT '订单金额',
  `to` int(11) DEFAULT NULL COMMENT '收货地址id',
  `address` int(11) NOT NULL COMMENT '收货地址外键',
  `alipayCode` varchar(30) DEFAULT NULL COMMENT '支付宝订单',
  `orderCode` varchar(50) NOT NULL COMMENT '订单号',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间，默认为当前时间',
  `state` int(11) NOT NULL DEFAULT '1' COMMENT '订单状态 1：待支付 1.待收货3.交易完成',
  `logidtics` varchar(50) DEFAULT NULL COMMENT '物流信息单号',
  `endTime` time DEFAULT NULL COMMENT '结束时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `orderCode` (`orderCode`),
