/*Table structure for table `order_details` */

DROP TABLE IF EXISTS `order_details`;

CREATE TABLE `order_details` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `oid` int(11) NOT NULL COMMENT '外键 订单id',
  `sid` int(11) DEFAULT NULL COMMENT '商店id',
  `gid` int(11) NOT NULL COMMENT '外键商品id',
  `number` int(11) NOT NULL COMMENT '数量',
  `price` decimal(10,2) NOT NULL COMMENT '单价',
  PRIMARY KEY (`id`),
  KEY `fk_order_details_order_oid` (`oid`),
  KEY `fk_order_details_order_gid` (`gid`),
  CONSTRAINT `fk_order_details_order_gid` FOREIGN KEY (`gid`) REFERENCES `good` (`id`),
  CONSTRAINT `fk_order_details_order_oid` FOREIGN KEY (`oid`) REFERENCES `order` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

/*Data for the table `order_details` */

/*Table structure for table `property` */

DROP TABLE IF EXISTS `property`;

CREATE TABLE `property` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `gid` int(11) DEFAULT NULL COMMENT '商品id',
  `key` varchar(20) NOT NULL COMMENT 'key',
  `value` varchar(100) NOT NULL COMMENT 'value数组',
  PRIMARY KEY (`id`),
  KEY `fk_property_good_gid` (`gid`),
  CONSTRAINT `fk_property_good_gid` FOREIGN KEY (`gid`) REFERENCES `good` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

