/*Table structure for table `shop` */

DROP TABLE IF EXISTS `shop`;

CREATE TABLE `shop` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `uid` int(11) NOT NULL COMMENT '用户外键',
  `name` varchar(50) NOT NULL COMMENT '名称',
  `describe` varchar(20) DEFAULT NULL COMMENT '描述',
  `address` varchar(255) NOT NULL COMMENT '地址',
  `picPath` varchar(50) DEFAULT 'shop.jpg' COMMENT '图片',
  `liker` int(11) DEFAULT '0' COMMENT '粉丝数',
  `level` int(11) DEFAULT '0' COMMENT '等级',
  `type1` int(11) DEFAULT NULL COMMENT '一级分类',
  `type2` int(11) DEFAULT NULL COMMENT '二级分类',
  `type3` int(11) DEFAULT NULL COMMENT '三级分类',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '状态 0:待审核 1.审核通过 2.暂停营业',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  KEY `fk_shop_user_uid` (`uid`),
  KEY `fk_shop_cate_type1` (`type1`),
  KEY `fk_shop_cate_type2` (`type2`),
  KEY `fk_shop_cate_type3` (`type3`),
  CONSTRAINT `fk_shop_cate_type1` FOREIGN KEY (`type1`) REFERENCES `category` (`id`),
  CONSTRAINT `fk_shop_cate_type2` FOREIGN KEY (`type2`) REFERENCES `category` (`id`),
  CONSTRAINT `fk_shop_cate_type3` FOREIGN KEY (`type3`) REFERENCES `category` (`id`),
  CONSTRAINT `fk_shop_user_uid` FOREIGN KEY (`uid`) REFERENCES `user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

