/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id自增',
  `userCode` varchar(50) NOT NULL COMMENT '用户账号',
  `userName` varchar(20) NOT NULL COMMENT '用户登录名称',
  `userPassword` varchar(255) NOT NULL COMMENT '用户登录密码',
  `userRole` int(11) NOT NULL COMMENT '用户角色 1.admin  2. audit  3. user ',
  `idCard` varchar(18) NOT NULL COMMENT '身份证',
  `realName` varchar(20) NOT NULL COMMENT '真实姓名',
  `phone` varchar(11) DEFAULT NULL COMMENT '电话',
  `address` varchar(255) DEFAULT NULL COMMENT '住址',
  `email` varchar(50) DEFAULT NULL COMMENT 'email',
  `userPic` varchar(20) DEFAULT 'default.jpg' COMMENT '用户图片',
  `score` int(11) DEFAULT '0' COMMENT '积分',
  `superUser` int(11) DEFAULT '0' COMMENT '是否会员0否1是',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '账户创建时间',
  `modifyTime` datetime DEFAULT NULL COMMENT '账户修改时间',
  `modifyBy` int(11) DEFAULT NULL COMMENT '修改者',
  `lastLoginTime` datetime DEFAULT NULL COMMENT '最后登录时间',
  `loginState` int(11) DEFAULT '0' COMMENT '登录状态',
  `sex` char(2) DEFAULT '男' COMMENT '性别',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `createBy` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `userCode` (`userCode`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8;

